import React, { useState } from "react";
// import { v4 as uuidv4 } from "uuid";
import "../NoteList/NoteList.scss";

function NoteList({ note }) {
  console.log("nates:", note);
  return (
    <div className="note__list">
      {note.map((list) => {
        return (
          <div key={list.id}>
            <p>{list.text}</p>
          </div>
        );
      })}
    </div>
  );
}

export default NoteList;
